import React from "react";
import classes from "./Error.module.css";
import MainNavigation from "../components/MainNavigation";

const Error = () => {
  return (
    <>
      <MainNavigation />
      <div className={classes.error}>
        <h1>Error!</h1>
        <p>Couldnt fetch</p>
      </div>
    </>
  );
};

export default Error;
